import "./App.css";

function App() {
  return (
    <div className="App">
      <h1>Hello</h1>
      <SideBar />
    </div>
  );
}
function SideBar() {
  return (
    <div className="bg-purple-400">
      <p>SideBar</p>
    </div>
  );
}
export default App;
